    data: |
      SELECT - 92 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - col0 NOT BETWEEN + + col2 * ( - + col1 ) AND - 66 * - CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q7414.out
    data: |
